INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (44, "東山奈央", "ヒヨリ", "A", "トゥインクルウィッシュ", 100101, 155, "人助け、応援", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, 16, 8, "獣人族", 2, "人助けが大好き！　前向き格闘娘", 0);
