INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (27, "諸星すみれ", "ミソギ", "O", "リトルリリカル", 100401, 128, "いたずら、探検", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, 9, 8, "ヒューマン", 5, "探検好きのイタズラっ子", 0);
