INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (42, "浅倉杏美", "アカリ", "O", "悪魔偽王国軍（ディアボロス）", 100601, 150, "サックス", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, 13, 11, "魔族", 7, "甘え上手なみんなの人気者", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (32, "雨宮天", "ミヤコ", "B", "悪魔偽王国軍（ディアボロス）", 100701, 130, "プリンを食べること", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, 14, 1, "魔族", 7, "プリン大好きゴースト娘", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (40, "大空直美", "ユキ", "AB", "ヴァイスフリューゲル　ランドソル支部", 100801, 150, "鏡で自分を見ること", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, 14, 10, "エルフ", 15, "ボクは誰よりも美しい", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (45, "髙野麻美", "アンナ", "A", "トワイライトキャラバン", 100901, 159, "小説執筆", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, 17, 7, "魔族", 13, "前世を信じる中二病患者、「疾風の冥姫」", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (42, "内田真礼", "マホ", "O", "自警団（カォン）", 101001, 155, "空想、ぬいぐるみ集め", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, 16, 9, "獣人族", 10, "マホマホ王国のプリンセス", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (44, "阿澄佳奈", "リノ", "A", "ラビリンス", 101101, 156, "お裁縫", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, 15, 8, "ヒューマン", 3, "人懐っこくてマシンガントークな妹系少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (46, "大橋彩香", "ハツネ", "A", "フォレスティエ", 101201, 156, "妹と遊ぶこと、二度寝、昼寝、早寝", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, 17, 12, "エルフ", 6, "みんなのために超能力を使う眠り姫", 0);
