INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (48, "上坂すみれ", "スズナ", "O", "ルーセント学院", 101601, 167, "ファッション", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, 17, 4, "魔族", 14, "天真爛漫で人気者のカリスマモデル", 0);
