INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (21, "日高里菜", "ミミ", "O", "リトルリリカル", 102001, 117, "かわいいもの集め", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, 10, 4, "獣人族", 5, "お歌もにんじんも、ウサギさんも大好き♪", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (40, "植田佳奈", "クルミ", "B", "サレンディア救護院", 102101, 150, "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, 12, 6, "ヒューマン", 9, "泣き虫で臆病な守ってあげたい女の子", 0);
