INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (43, "橋本ちなみ", "エリコ", "B", "トワイライトキャラバン", 102701, 154, "実験、裁縫、料理", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, 16, 7, "魔族", 13, "運命の相手に一途すぎる乙女", 0);
