INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (42, "大坪由佳", "シノブ", "AB", "悪魔偽王国軍（ディアボロス）", 103101, 157, "占い", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, 18, 12, "魔族", 7, "占いが得意な霊能少女", 0);
