INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (54, "小松未可子", "マコト", "O", "自警団（カォン）", 104301, 168, "お菓子作り", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, 17, 8, "獣人族", 10, "男勝りで情に厚いワイルド娘", 0);
