INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (49, "田所あずさ", "ミフユ", "O", "メルクリウス財団", 104801, 163, "傭兵などのアルバイト", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 20, 11, "ヒューマン", 12, "仕事も私事も効率優先な傭兵少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (54, "生天目仁美", "シズル", "O", "ラビリンス", 104901, 168, "家事全般", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, 18, 10, "ヒューマン", 3, "お姉ちゃんがお世話してあげるからねっ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "久野美咲", "ミサキ", "A", "ルーセント学院", 105001, 120, "ファッション誌鑑賞、コスメ集め", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, 11, 1, "魔族", 14, "ちょっとおませな恋に恋する女の子", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (53, "三石琴乃", "ミツキ", "A", "トワイライトキャラバン", 105101, 166, "研究、実験", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, 27, 3, "ヒューマン", 13, "実験が趣味の危険な科学者", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (100, "徳井青空", "リマ", "A", "牧場（エリザベスパーク）", 105201, 150, "毛繕い、お喋り", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 14, 17, 3, "獣人族", 11, "乙女チックなもふもふアニマル", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (33, "辻あゆみ", "モニカ", "A", "ヴァイスフリューゲル　ランドソル支部", 105301, 140, "お菓子屋通い", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 28, 17, 7, "ヒューマン", 15, "見た目も中身もお子ちゃまな異国の軍人", 0);
