INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (45, "金元寿子", "ジータ", "O", "？？？", 105701, 156, "冒険、おしゃべり", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 10, 17, 3, "ヒューマン", "", "空への冒険を夢見る騎空士の少女", 0);
