INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (48, "沼倉愛美", "タマキ（サマー）", "AB", "メルクリウス財団", 107901, 158, "猫とたわむれること", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, 19, 3, "獣人族", 12, "弱きを助け強きをくじく猫娘", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (49, "田所あずさ", "ミフユ（サマー）", "O", "メルクリウス財団", 108001, 163, "傭兵などのアルバイト", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, 20, 11, "ヒューマン", 12, "仕事も私事も効率優先な傭兵少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (42, "大坪由佳", "シノブ（ハロウィン）", "AB", "悪魔偽王国軍（ディアボロス）", 108101, 157, "占い", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, 18, 12, "魔族", 7, "占いが得意な霊能少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (32, "雨宮天", "ミヤコ（ハロウィン）", "B", "悪魔偽王国軍（ディアボロス）", 108201, 130, "プリンを食べること", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, 14, 1, "魔族", 7, "プリン大好きゴースト娘", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (22, "久野美咲", "ミサキ（ハロウィン）", "A", "ルーセント学院", 108301, 120, "ファッション誌鑑賞、コスメ集め", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, 11, 1, "魔族", 14, "ちょっとおませな恋に恋する女の子", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (46, "福原綾香", "チカ（クリスマス）", "O", "カルミナ", 108401, 163, "各種楽器", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, 17, 6, "ヒューマン", 4, "人々を守るために歌う、唱喚士の少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (40, "植田佳奈", "クルミ（クリスマス）", "B", "サレンディア救護院", 108501, 150, "観劇、おままごと", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, 12, 6, "ヒューマン", 9, "泣き虫で臆病な守ってあげたい女の子", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (38, "芹澤優", "アヤネ（クリスマス）", "B", "サレンディア救護院", 108601, 148, "屋内でできる遊び", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, 14, 5, "ヒューマン", 9, "ぷうきちといつも一緒！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (44, "東山奈央", "ヒヨリ（ニューイヤー）", "A", "トゥインクルウィッシュ", 108701, 155, "人助け、応援", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, 16, 8, "獣人族", 2, "人助けが大好き！　前向き格闘娘", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (47, "種田梨沙", "ユイ（ニューイヤー）", "O", "トゥインクルウィッシュ", 108801, 158, "料理、人間観察", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, 17, 4, "ヒューマン", 2, "戦闘のサポートが得意な、心優しい少女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (46, "早見沙織", "レイ（ニューイヤー）", "B", "トゥインクルウィッシュ", 108901, 163, "読書、乗馬、お茶", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, 18, 1, "魔族", 2, "クールで何事にも真っ直ぐな剣士", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (43, "橋本ちなみ", "エリコ（バレンタイン）", "B", "トワイライトキャラバン", 109001, 154, "実験、裁縫、料理", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, 16, 7, "魔族", 13, "運命の相手に一途すぎる乙女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (54, "生天目仁美", "シズル（バレンタイン）", "O", "ラビリンス", 109101, 168, "家事全般", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, 18, 10, "ヒューマン", 3, "お姉ちゃんがお世話してあげるからねっ！", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (55, "日笠陽子", "アン", "AB", "？？？", 109201, 156, "読書", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 1, 17, 12, "ヒューマン", "", "英霊と契約を結んだマナリアの天才王女", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (45, "こやまきみこ", "ルゥ", "O", "？？？", 109301, 144, "食べること、眠ること", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 4, 16, 2, "ヒューマン", "", "マナリア魔法学院の新入生", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (67, "福原綾香", "グレア", "B", "？？？", 109401, 167, "ピアノ", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 3, 17, 11, "半人半竜", "", "人を超越した力を有す心優しい竜姫", 0);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (49, "長妻樹里", "クウカ（オーエド）", "AB", "ヴァイスフリューゲル　ランドソル支部", 109501, 157, "小説を読むこと", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, 18, 11, "ヒューマン", 15, "妄想大好き！　ほんとは照れ屋な女の子", 0);
